import { slidesList } from "../Slideshow/slideshowData";

function TodoList() {
    return(
        <div className="todolist-wrapper">
            <h4>TODO LIST</h4>
            {/* Here we make the part that filter what is shown in the list */}
            <input type="text"></input>
            <ul>
                {slidesList.map((item) => {
                    return (
                        <li>{item.name}</li>
                    )
                })}
            </ul>
            {/* Here we make the part that add new item */}
        </div>
    )
}

export {TodoList};
